import logo from './logo.svg';
import './App.css';
import data from './data.js'
import Card from './components/Card.jsx'
function App() {
  return (
    <div className="App">

      {
        data.map(productData => <Card image = {productData.image} price = {productData.price} description = {productData.description} />)
      }
    </div>
  );
}

export default App;
